import React, { useState } from "react";
import "./DriverInfo.css";

const DriverInfo = () => {
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    dateOfBirth: "",
    gender: "male",
    maritalStatus: "Single",
    insured: true,
    insuredForYear: true,
    sr22: false,
    dui: false,
    homeOwner: true,
    military: false,
    accidents: "0",
    creditScore: "Good",
  });

  const [errors, setErrors] = useState({});

  const handleToggle = (key) => {
    setForm((prev) => ({ ...prev, [key]: !prev[key] }));
  };

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const validateForm = () => {
    const newErrors = {};
    // Check if first name and last name are valid
    if (!form.firstName || !/^[a-zA-Z]+$/.test(form.firstName)) {
      newErrors.firstName = "First name is required and must be valid.";
    }
    if (!form.lastName || !/^[a-zA-Z]+$/.test(form.lastName)) {
      newErrors.lastName = "Last name is required and must be valid.";
    }
    // Check if date of birth is provided
    if (!form.dateOfBirth) {
      newErrors.dateOfBirth = "Date of birth is required.";
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleNextStep = () => {
    if (validateForm()) {
      alert("Form is valid. Proceeding to the next step...");
    } else {
      alert("Please fix the errors in the form.");
    }
  };

  return (
    <div className="driver-info">
      <h2>Driver's Information</h2>

      <div className="driver-section">
        <div className="form-row">
          <div className="form-group">
            <label>First Name</label>
            <input
              type="text"
              name="firstName"
              placeholder="Enter first name"
              value={form.firstName}
              onChange={handleChange}
              className={errors.firstName ? "error" : ""}
            />
            {errors.firstName && (
              <span className="error-message">{errors.firstName}</span>
            )}
          </div>
          <div className="form-group">
            <label>Last Name</label>
            <input
              type="text"
              name="lastName"
              placeholder="Enter last name"
              value={form.lastName}
              onChange={handleChange}
              className={errors.lastName ? "error" : ""}
            />
            {errors.lastName && (
              <span className="error-message">{errors.lastName}</span>
            )}
          </div>
        </div>

        <div className="form-row">
          <div className="form-group">
            <label>Date of Birth</label>
            <input
              type="date"
              name="dateOfBirth"
              value={form.dateOfBirth}
              onChange={handleChange}
              className={errors.dateOfBirth ? "error" : ""}
            />
            {errors.dateOfBirth && (
              <span className="error-message">{errors.dateOfBirth}</span>
            )}
          </div>
          <div className="form-group">
            <label>Gender</label>
            <div className="toggle-buttons">
              <button
                className={form.gender === "male" ? "active" : ""}
                onClick={() => setForm({ ...form, gender: "male" })}
              >
                Male
              </button>
              <button
                className={form.gender === "female" ? "active" : ""}
                onClick={() => setForm({ ...form, gender: "female" })}
              >
                Female
              </button>
            </div>
          </div>
        </div>

        <div className="form-grid">
          {/* Other fields like insured, SR22, etc., go here */}
        </div>
      </div>

      <button className="next-step" onClick={handleNextStep}>
        Next Step
      </button>
    </div>
  );
};

export default DriverInfo;
